import React, {Component} from "react";
import classes from "./Landing.module.css";

class Landing extends Component {
    state={
        landingRef : React.createRef()
    }

    render(){

        let place = 0;
        window.addEventListener("scroll", (e)=>{
            if(this.state.landingRef.current){
            place = window.pageYOffset;
            this.state.landingRef.current.style.transform = `translate(0%,${place}px)`;
            }
        })


        return(
            <div className = {classes.LandingContainer}>
                <div className = {classes.Landing} ref = {this.state.landingRef}>
                    <p>Phinney Ridge Eyecare</p>
                </div>
                <div className = {classes.PhotoContainer}>
                    <p>Come Enjoy the View</p>
                </div>
            </div>



        )


    }


}

export default Landing;
